import React from "react";
import Head from "next/head";

const index = () => {
  return (
    <div>
      <Head>
        <title>Home</title>
        <link
          href="https://fonts.googleapis.com/css?family=Poppins|Quicksand|Racing+Sans+One&display=swap"
          rel="stylesheet"
        />
      </Head>
    </div>
  );
};

export default index;
